const Cart = (props) => {
  const cartItems = [
    { id: "c1", name: "Sushi", price: "22.99", amount: "1" },
    { id: "c2", name: "Schnitzel", price: "16.5", amount: "4" },
  ];
  return (
    <div>
      <ul>{cartItems.map(cartItem)}</ul>
      <div></div>
      <div></div>
    </div>
  );
};
export default Cart;
